import { instanceKream } from "../services"

export const getDataMenu = async() => {
    const response = await instanceKream.get('https://kream.co.kr/api/p/brands/Jordan/tabs/all/?cursor?&&request_key=8057a8a7-6631-4069-98c0-afd140d52fd7')
    const data = response.data.items.map(
        (item) => {
            const result = item.product.release
            return {
                code: result.style_code
            }
        }
    )

    return data
}
